import { useState } from "react";
import Navbar from "../../components/navbar/Navbar";
import "./home.css";


const Home = () => {
  const [value, setValue] = useState(null)
  return (
    <div>
    <div>
      <Navbar />
      
    </div>
      <textarea type="text" value={value} onChange={(e) => setValue(e.target.value)}/>
    </div>
  )
}

export default Home
